branchCategory.description:
&lt;p&gt;
The MSQ compact rotary table is ideal for material transfer applications. It incorporates load bearings and a mounting face with a rack-and-pinion style rotary actuator. The seven sizes are 10, 20, 30, 50, 70, 100, and 200 with rotational adjustments from 0-190 degrees, and auto switch capability. Additional features include a hollow shaft and direct load mounting possibility.
&lt;/p&gt;

